import { BrowserRouter, Routes, Route } from "react-router-dom";
import "./App.css";
import Navbar from "./components/navbar";
import Footer from "./components/footer";
import MenProductList from "./pages/products/men";
import NewProductList from "./pages/products/new";
import WoMenProductList from "./pages/products/women";
import KidsProductList from "./pages/products/kids";
import SportsProductList from "./pages/products/sports";
import HotsleProductList from "./pages/products/hotsale";
import ProductsDetails from "./pages/products/details";
import Home from "./pages/homepage";
import ContactUS from "./pages/contactus";
import LogSignIn from "./pages/login/signin";
import LogSignUp from "./pages/login/signup";

function App() {
  return (
    <BrowserRouter>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/products/new/:slug" element={<NewProductList />} />
        <Route path="/products/men/:slug" element={<MenProductList />} />
        <Route path="/products/women/:slug" element={<WoMenProductList />} />
        <Route path="/products/kids/:slug" element={<KidsProductList />} />
        <Route path="/products/sports/:slug" element={<SportsProductList />} />
        <Route
          path="/products/hotsales/:slug"
          element={<HotsleProductList />}
        />
        <Route path="/products/details/:slug" element={<ProductsDetails />} />
        <Route path="/contact/" element={<ContactUS />} />
        <Route path="/user/login" element={<LogSignIn />} />
        <Route path="/register/user" element={<LogSignUp />} />
      </Routes>
      <Footer />
    </BrowserRouter>
  );
}

export default App;
